import React, { useState } from 'react';
import { 
  Box, 
  Heading, 
  SimpleGrid, 
  Button, 
  Flex, 
  Input,
  InputGroup,
  InputLeftElement,
  Spinner,
  Text,
  Badge,
  Progress,
  useToast,
  Alert,
  AlertIcon
} from '@chakra-ui/react';
import { SearchIcon } from '@chakra-ui/icons';
import { useNavigate } from 'react-router-dom';
import { useExpeta } from '../context/ExpetaContext';

const ValidationsPage = () => {
  const { validations, loadValidations, loading, error } = useExpeta();
  const [searchQuery, setSearchQuery] = useState('');
  const navigate = useNavigate();
  const toast = useToast();

  // Filter validations based on search query
  const filteredValidations = validations?.filter(val => 
    val.expectation?.name?.toLowerCase().includes(searchQuery.toLowerCase()) || 
    val.expectation?.description?.toLowerCase().includes(searchQuery.toLowerCase())
  ) || [];

  const handleRefresh = async () => {
    try {
      await loadValidations();
      toast({
        title: 'Validations refreshed',
        status: 'success',
        duration: 2000,
        isClosable: true
      });
    } catch (err) {
      toast({
        title: 'Error refreshing validations',
        description: err.message,
        status: 'error',
        duration: 3000,
        isClosable: true
      });
    }
  };

  const handleViewValidation = (id) => {
    navigate(`/validations/${id}`);
  };

  const formatDate = (dateString) => {
    if (!dateString) return 'Unknown date';

    const date = new Date(dateString);
    return date.toLocaleDateString() + ' ' + date.toLocaleTimeString();
  };

  return (
    <Box>
      <Flex justify="space-between" align="center" mb={6}>
        <Heading size="lg">Code Validations</Heading>
        <Button 
          colorScheme="blue" 
          variant="outline"
          onClick={handleRefresh}
        >
          Refresh
        </Button>
      </Flex>

      <Box mb={6}>
        <InputGroup>
          <InputLeftElement pointerEvents="none">
            <SearchIcon color="gray.300" />
          </InputLeftElement>
          <Input 
            placeholder="Search validations..." 
            value={searchQuery}
            onChange={(e) => setSearchQuery(e.target.value)}
          />
        </InputGroup>
      </Box>

      {loading.validations ? (
        <Flex justify="center" align="center" my={10}>
          <Spinner size="xl" />
          <Text ml={4}>Loading validations...</Text>
        </Flex>
      ) : error.validations ? (
        <Alert status="error" mb={6} borderRadius="md">
          <AlertIcon />
          {error.validations}
        </Alert>
      ) : filteredValidations.length === 0 ? (
        <Box p={10} textAlign="center" bg="gray.50" borderRadius="md">
          <Text mb={4}>No validations found</Text>
          <Button colorScheme="blue" onClick={handleRefresh}>
            Refresh
          </Button>
        </Box>
      ) : (
        <SimpleGrid columns={{ base: 1, md: 2 }} spacing={6}>
          {filteredValidations.map((validation) => (
            <Box 
              key={validation.id}
              p={5}
              shadow="md"
              borderWidth="1px"
              borderRadius="md"
              bg="white"
              onClick={() => handleViewValidation(validation.id)}
              cursor="pointer"
              _hover={{ shadow: "lg" }}
            >
              <Flex justify="space-between" mb={2}>
                <Heading fontSize="lg">{validation.expectation?.name || 'Unnamed Expectation'}</Heading>
                <Badge colorScheme={validation.passed ? 'green' : 'red'}>
                  {validation.passed ? 'Passed' : 'Failed'}
                </Badge>
              </Flex>

              <Text fontSize="sm" color="gray.500" mb={3}>
                Validated: {formatDate(validation.created_at)}
              </Text>

              <Box mb={4}>
                <Flex justify="space-between" mb={1}>
                  <Text fontSize="sm">Semantic Match:</Text>
                  <Text fontSize="sm" fontWeight="bold">
                    {Math.round((validation.semantic_match?.match_score || 0) * 100)}%
                  </Text>
                </Flex>
                <Progress 
                  value={Math.round((validation.semantic_match?.match_score || 0) * 100)} 
                  colorScheme="blue" 
                  size="sm" 
                  borderRadius="md"
                />
              </Box>

              {validation.test_results && (
                <Box>
                  <Flex justify="space-between" mb={1}>
                    <Text fontSize="sm">Tests:</Text>
                    <Text fontSize="sm" fontWeight="bold">
                      {validation.test_results.pass_rate ? 
                        `${Math.round(validation.test_results.pass_rate * 100)}%` : 'N/A'}
                    </Text>
                  </Flex>
                  <Progress 
                    value={Math.round((validation.test_results?.pass_rate || 0) * 100)} 
                    colorScheme="green" 
                    size="sm" 
                    borderRadius="md"
                  />
                </Box>
              )}
            </Box>
          ))}
        </SimpleGrid>
      )}
    </Box>
  );
};

export default ValidationsPage;
